import React from "react";
import { render } from "react-dom";
import { HashRouter as Router, Route } from "react-router-dom";


function getParams(location) {

  const searchParams = new URLSearchParams(location.search);

   console.log("queyrt is "+searchParams);
  return {
    query: searchParams.get("client_id") || ""
  };
}



const MainPage = props => {
  const { query, history } = props;
  return (
    <div style={{background: 'black', color: 'white'}}>

      <h2>{`My query: ${query}`}</h2>
      <ResultsPage query={query} />


    </div>
  );
};


class ResultsPage extends React.Component {
  state = { results: [], loading: false, error: false };



  componentDidMount() {

    console.log(this.props.query);
  }


  render() {
    if (this.state.loading) {
      return <div >Loading ... </div>;
    }

    if (this.state.results.length === 0) {
      return <div >No results</div>;
    }
    return (
      <div>
        {this.state.results.map(repo => (
          <div className="repo" key={repo.id}>
            <a className="repo-link" href={repo.html_url}>
              {repo.name}
            </a>
            <div className="repo-owner">{`by ${repo.owner.login}`}</div>
          </div>
        ))}
      </div>
    );
  }
}






const App = () => (
  <React.Fragment>
    <Router>
      <React.Fragment>
        <Route
          path="/"
          render={({ location, history }) => {
            const { query } = getParams(location);
             console.log("queyrt us starta" +{ query });

            return <MainPage query={query} history={history} />;
          }}
        />
      </React.Fragment>
    </Router>
  </React.Fragment>
);

render(<App />, document.getElementById("root"));

export default App;
